import React from "react"
import RegistrationFormStyles from "./registrationForm.module.scss"
import {Formik, FastField,Field,Form} from "formik"
import * as Yup from "yup"

const initialValues = {
    Email:"",
    Password:""
}
export default ({children})=>{
    const validationSchema = Yup.object({
        Email:Yup.string().nullable().email().required("Enter your email"),
        password:Yup.string().nullable.required("password").max(3)
    })

    return(
        <div className={RegistrationFormStyles.container}>
            <Formik
                initialValues
                validationSchema>


            </Formik>



            {children}

        </div>
    )
}
